Before moving on, we will describe, at a high level, how inputs can be composed together using EverAfter reactivity, and how such a composition avoids adding overhead for each composition. Consider the following from-scratch program. function fullName(first: string, last: string): string { return `${first} ${last}`;
} function program(first: string, last: string, title: string) { let header = document.createElement("h1"); let titleNode = document.createTextNode(title); header.appendChild(titleNode); let paragraph = document.createElement("p"); let nameNode = document.createTextNode(fullName(first, last)); paragraph.appendChild(lastNode); let div = document.createElement("div"); div.appendChild(header); div.appendChild(paragraph); return div;
} Fig. 2. The code listing for a from-scratch program demonstrating composition This program expects three reactive variables (first, last and title). It derives fullName from first and last, which becomes the input to nameNode. As before, title is the input to titleNode. stateDiagram state program { state paragraph { nameNode --&gt; fullName fullName --&gt; first fullName --&gt; last } state header { titleNode --&gt; title } } state legend { variable derived output } Fig 3. A diagram of the data flow described by the code in Fig. 2 When the user changes the inputs, the changes are propagated much the same way as in Fig. 1. Fig. 4 elaborates the consequences of composition. sequenceDiagram participant User participant Inputs participant Output rect rgb(200, 200, 200) Note over User,Inputs: User initializes the inputs User-&gt;&gt;Inputs: Initialize title to "hello world" User-&gt;&gt;Inputs: Initialize first to "Matt" User-&gt;&gt;Inputs: Initialize last to "Hammer" end rect rgb(220, 220, 220) Note over Inputs,Output: Initialize the system rect rgb(180, 180, 180) Note over Inputs,Output: Initialize header Output-&gt;&gt;Inputs: What is the value of title? Inputs-&gt;&gt;Output: "hello world" Output--&gt;&gt;Inputs: What is the timestamp of title? Inputs--&gt;&gt;Output: ¬´1¬ª end Note right of Output: Create text node Note right of Output: Last timestamp: ¬´1¬ª rect rgb(180, 180, 180) Note over Inputs,Output: Initialize paragraph rect rgb(160, 160, 160) rect rgba(160, 160, 160, 0.5) Output-&gt;&gt;Inputs: What is the value of first? Inputs-&gt;&gt;Output: "Matt" Output--&gt;&gt;Inputs: What is the timestamp of first? Inputs--&gt;&gt;Output: ¬´1¬ª end rect rgba(160, 160, 160, 0.5) Output-&gt;&gt;Inputs: What is the value of last? Inputs-&gt;&gt;Output: "Hammer" Output--&gt;&gt;Inputs: What is the timestamp of last? Inputs--&gt;&gt;Output: ¬´1¬ª end end Note left of Output: Invoke fullName with "Matt" and "Hammer" Note left of Output: Result: "Matt Hammer" end Note ri