right of Output: Update fullName üî® Note right of Output: Last timestamp: ¬´3¬ª end end Fig. 4. Change propagation through composition. We can make a few observations. First, because fullName is composed of first and last, we could remember a single timestamp for the entire composition, and validate each of its inputs using that timestamp. This means that abstractions do not increase overhead: we only need to store a single timestamp for all of the inputs to an abstraction, and validating an abstraction just means validating the inputs to the abstraction. Second, because fullName is not itself reactive, the algorithm needs to derive it again from its inputs whenever any of its inputs change. This means the algorithm doesn't need to memoize first, last or the result of calling fullName at all. If neither of first or last changed, the output remains up to date. If either first or last changes, the algorithm acquires the most recent version of both and calls the fullName function again, updating the output. In some cases, it might be more efficient to memoize a derived value that is used as an input into other derived values. As we'll show later, EverAfter reactivity is expressive enough to allow memoization where necessary, but does not impose the cost of memoization where it would provide little value. In earlier implementations of this algorithm, we more aggressively memoized inputs. After changing the algorithm to default to validation without memoization, as illustrated above, we found that the vast majority of caches were unused, and the overall performance of the system at scale improved substantially. The archivist role (ar) corresponds to computation whose dependencies we cache, and the editor role ( \( \mathtt{ed} \) ) corresponds to computation that feeds the archivist with input changes, and demands any changed output that is relevant; in short, the editor represents the world outside the cached computation.
